@lopezobrador_ Viva la democracia y muera el mal gobierno.

Te recuerdo que quien creé en la democracia y al minuto siguiente sale a gritar que hubo fraude por que no ganó su favorito, no es demócrata. Es un payaso, un mal perdedor, un berrinchudo.

Y eso, también lo vamos a exhibir al mundo.
